class DataProcessor:
    def __init__(self):
        self.submissions = []
        self.errors = []

    def delete_old_submissions(self, date):
        before_deletion = len(self.submissions)
        self.submissions = [s for s in self.submissions if s['date'] != date]
        after_deletion = len(self.submissions)
        return before_deletion - after_deletion

    def log_error(self, error_message):
        self.errors.append(error_message)

    def update_submission_status(self, submission_id, new_status):
        for submission in self.submissions:
            if submission['id'] == submission_id:
                submission['status'] = new_status
                return submission
        return None


class UserInterface:
    def request_user_testing(self):
        print("User testing requested. Feedback will be gathered.")

class User:
    def __init__(self, data_processor):
        self.data_processor = data_processor

    def submit_data(self, data):
        submission = {
            'id': len(self.data_processor.submissions) + 1,
            'data': data,
            'status': 'submitted',
            'date': '2023-10-01'
        }
        self.data_processor.submissions.append(submission)

    def upload_file(self, file_path):
        print(f"File {file_path} uploaded successfully.")

    def download_file(self, file_id):
        for submission in self.data_processor.submissions:
            if submission['id'] == file_id:
                print(f"Downloading file for submission ID {file_id}.")
                return submission
        print("File not found.")
        return None


class ValidationHandler:
    def validate_duns_status(self, duns_number):
        # Dummy validation logic
        valid_duns = ["123456789", "987654321"]
        return duns_number in valid_duns

    def validate_fabs_submission(self, submission):
        # Dummy validation logic
        return submission['status'] != 'published'


# Example usage:
data_processor = DataProcessor()
user = User(data_processor)
validation_handler = ValidationHandler()
ui = UserInterface()

# User submits data
user.submit_data({"name": "Sample Data", "amount": 1000})

# User uploads a file
user.upload_file("data_file.csv")

# Validate DUNS status
if validation_handler.validate_duns_status("123456789"):
    print("DUNS status is valid.")

# Validate FABS submission
if validation_handler.validate_fabs_submission(data_processor.submissions[0]):
    print("FABS submission is valid.")

# Update submission status
data_processor.update_submission_status(1, "processed")

# Log an error
